import React , {useState} from 'react'
import './الملاعب.css' ;

import {Inject , ScheduleComponent , Day , Week ,WorkWeek ,Month } from '@syncfusion/ej2-react-schedule';

function الملاعب()  {
   
  const [star , setStar ]= useState(false) ;
  const [san , setSan ]= useState(false) ;
  const [sentiage , setSentiage ]= useState(false) ;
  const [elshrouk , setElshrouk ]= useState(false) ;
      return(
        <div className="الملاعب">
         
         
          
         <button onClick={ ()=> { setStar(!star) ; setSan(false)  ; setSentiage(false); setElshrouk(false)   } }  >
           Star Park
         </button>

         <button onClick={()=> { setStar(false) ; setSan(!san)  ; setSentiage(false); setElshrouk(false)   }  }>
           San Sero
         </button>

         <button onClick={()=>{ setStar(false) ; setSan(false)  ; setSentiage(!sentiage); setElshrouk(false)   }}>
           Sentiage
         </button>

         <button onClick={()=>{ setStar(false) ; setSan(false)  ; setSentiage(false); setElshrouk(!elshrouk)   }}>
           Elshrouk
         </button>

          <div className="table">
          {
            star? //  <table className="star-table">
            //             <thead>
            //               <tr>
            //                 <th>#</th>
            //                 <th>12 pm</th>
            //                 <th>1 pm</th>
            //                 <th>2 pm</th>
            //                 <th>3 pm</th>
            //                 <th>4 pm</th>
            //                 <th>5 pm</th>
            //                 <th>6 pm</th>
            //                 <th>7 pm</th>
            //                 <th>8 pm</th>
            //                 <th>9 pm</th>
            //                 <th>10 pm</th>
            //                 <th>11 pm</th>
            //                 <th>12 am</th>
            //                 <th>1 am</th>
            //                 <th>2 am</th>
            //                 <th>3 am</th>
            //                 <th>4 am</th>
            //                 <th>5 am</th>
            //                 <th>6 am</th>
            //                 <th>7 am</th>
            //                 <th>8 am</th>
            //                 <th>9 am</th>
            //                 <th>10 am</th>
            //                 <th>11 am</th>
            //               </tr>
            //             </thead>
            //             <tbody>
            //               <tr>
            //                 <td>1/8</td>
            //                 <td></td>
            //                 <td></td>
            //                 <td></td>
            //               </tr>
            //               <tr>
            //                 <td>2/8</td>
            //                 <td></td>
            //                 <td></td>
            //                 <td></td>
            //               </tr>
            //               <tr>
            //                 <td>3/8</td>
            //                 <td ></td>
            //                 <td></td>
            //               </tr>
            //             </tbody>
            //           </table>
                <ScheduleComponent>
                   <Inject services={ [Day , Week ,WorkWeek ,Month ] } />
                </ScheduleComponent>

           :null
          }
         
           {
            san? <h1>San</h1>   :null
          }
            
           {
            sentiage? <h1>Sentiage</h1> :null
          }
          
           {
            elshrouk? <h1>Elshrouk</h1> :null
          }
          
          </div>
          
          
         
         
          
          
        </div>
      
      )
    
  
}

export default الملاعب ;
